import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Main from './src/components/Main.jsx';
import Home from './src/components/Home.jsx';
import Estudiante from './src/components/Estudiante.jsx'; // Importa la pantalla Estudiante
import Profesor from './src/components/Profesor.jsx'; // Importa la pantalla Profesor
import Admin from './src/components/Administrador.jsx'; // Importa la pantalla Admin

const Stack = createStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Main">
        <Stack.Screen
          name="Main"
          component={Main}
          options={{ title: 'Inicio' }}
        />
        <Stack.Screen
          name="Home"
          component={Home}
          options={{ title: 'Página de Inicio' }}
        />
        <Stack.Screen
          name="Estudiante"
          component={Estudiante}
          options={{ title: 'Página de Estudiante' }}
        />
        <Stack.Screen
          name="Profesor"
          component={Profesor}
          options={{ title: 'Página de Profesor' }}
        />
        <Stack.Screen
          name="Admin"
          component={Admin}
          options={{ title: 'Página de Administrador' }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
